import react from 'react';

function Logo(){
    return(
        <div className='logo'>
            <img
              src='src\assets\images\logo.png'
              alt="Integrity Protection"
              style={{ maxWidth: '150px', margin: '0 auto' }} // Adjust the max-width and margin
            />
        </div>
    )
}

export default Logo;
